import React from 'react' 
import PropTypes from 'prop-types'
//import './style.css'

export default function ScoreCard({Player1,Player2}) {
	return(
		<section className="c-score-card">
		<div className="c-score-card__player Player1-card"> {Player1} </div>
		<div className="c-score-card__space"> </div>
		<div className="c-score-card__player Player2-card"> {Player2} </div>
		</section>
		)
}
ScoreCard.propTypes = {
	player1: PropTypes.number.isRequired,
	player2: PropTypes.number.isRequired
}
